if mibBuilder.loadTexts: chipRptrMonitorPortReadableOctets.setReference('Reference IEEE 802.3 Rptr Mgt, 19.2.6.2, aReadableOctets.')
if mibBuilder.loadTexts: chipRptrMonitorPortReadableOctets.setStatus('mandatory')
if mibBuilder.loadTexts: chipRptrMonitorPortReadableOctets.setDescription('This object is the number of octets contained in valid frames that have been received on this port. This counter is incremented by OctetCount for each frame received on this port which has been determined to be a readable frame. This statistic provides an indicator of the total data transferred. The approximate minimum time for rollover of this counter is 58 minutes.')
chipRptrMonitorPortFCSErrors = MibTableColumn((1, 3, 6, 1, 4, 1, 49, 2, 3, 1, 5, 2, 5, 2, 3, 1, 1, 7), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: chipRptrMonitorPortFCSErrors.setReference('Reference IEEE 802.3 Rptr Mgt, 19.2.6.2, aFrameCheckSequenceErrors.')
if mibBuilder.loadTexts: chipRptrMonitorPortFCSErrors.setStatus('mandatory')
if mibBuilder.loadTexts: chipRptrMonitorPortFCSErrors.setDescription('This counter is incremented by one for each frame received on this port with the FCSError signal asserted and the FramingError and CollisionEvent signals deasserted and whose OctetCount is greater than or equal to minFrameSize and less than or equal to maxFrameSize (Ref: 4.4.2.1, IEEE 802.3 Std). The approximate minimum time for rollover of this counter is 80 hours.')
chipRptrMonitorPortAlignmentErrors = MibTableColumn((1, 3, 6, 1, 4, 1, 49, 2, 3, 1, 5, 2, 5, 2, 3, 1, 1, 8), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: chipRptrMonitorPortAlignmentErrors.setReference('Reference IEEE 802.3 Rptr Mgt, 19.2.6.2, aAlignmentErrors.')
if mibBuilder.loadTexts: chipRptrMonitorPortAlignmentErrors.setStatus('mandatory')
if mibBuilder.loadTexts: chipRptrMonitorPortAlignmentErrors.setDescription('This counter is incremented by one for each frame received on this port with the FCSError and FramingError signals asserted and CollisionEvent signal deasserted and whose OctetCount is greater than or equal to minFrameSize and less than or equal to maxFrameSize (Ref: IEEE 802.3 Std, 4.4.2.1). If chipRptrMonitorPortAlignmentErrors is incremented then the chipRptrMonitorPortFCSErrors Counter shall not be incremented for the same frame. The approximate minimum time for rollover of this counter is 80 hours.')
chipRptrMonitorPortFrameTooLongs = MibTableColumn((1, 3, 6, 1, 4, 1, 49, 2, 3, 1, 5, 2, 5, 2, 3, 1, 1, 9), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: chipRptrMonitorPortFrameTooLongs.setReference('Reference IEEE 802.3 Rptr Mgt, 19.2.6.2, aFramesTooLong.')
if mibBuilder.loadTexts: chipRptrMonitorPortFrameTooLongs.setStatus('mandatory')
if mibBuilder.loadTexts: chipRptrMonitorPortFrameTooLongs.setDescription('This counter is incremented by one for each frame received on this port whose OctetCount is greater than maxFrameSize (Ref: 4.4.2.1, IEEE 802.3 Std). If chipRptrMonitorPortFrameTooLongs is incremented then neither the chipRptrMonitorPortAlignmentErrors nor the chipRptrMonitorPortFCSErrors counter shall be incremented for the frame. The approximate minimum time for rollover of this counter is 61 days.')
chipRptrMonitorPortShortEvents = MibTableColumn((1, 3, 6, 1, 4, 1, 49, 2, 3, 1, 5, 2, 5, 2, 3, 1, 1, 10), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: chipRptrMonitorPortShortEvents.setReference('Reference IEEE 802.3 Rptr Mgt, 19.2.6.2, aShortEvents.')
if mibBuilder.loadTexts: chipRptrMonitorPortShortEvents.setStatus('mandatory')
if mibBuilder.loadTexts: chipRptrMonitorPortShortEvents.setDescription('This counter is incremented by one for each CarrierEvent on this port with ActivityDuration less than ShortEventMaxTime. ShortEventMaxTime is greater than 74 bit times and less than 82 bit times. ShortEventMaxTime has tolerances included to provide for circuit losses between a conformance test point at the AUI and the measurement point within the state machine. Note: shortEvents may indicate externally generated noise hits which will cause the repeater to transmit Runts to its other ports, or propagate a collision (which may be late) back to the transmitting DTE and damaged frames to the rest of the network. Implementors may wish to consider selecting the ShortEventMaxTime towards the lower end of the allowed tolerance range to accommodate bit losses suffered through physical channel devices not budgeted for within this standard. The approximate minimum time for rollover of this counter is 16 hours.')
chipRptrMonitorPortRunts = MibTableColumn((1, 3, 6, 1, 4, 1, 49, 2, 3, 1, 5, 2, 5, 2, 3, 1, 1, 11), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: chipRptrMonitorPortRunts.setReference('Reference IEEE 802.3 Rptr Mgt, 19.2.6.2, aRunts.')
if mibBuilder.loadTexts: chipRptrMonitorPortRunts.setStatus('mandatory')
if mibBuilder.loadTexts: chipRptrMonitorPortRunts.setDescription('This counter is incremented by one for each CarrierEvent on this port that meets one of the following two conditions. Only one test need be made. a) The ActivityDuration is greater than ShortEventMaxTime and less than ValidPacketMinTime and the CollisionEvent signal is deasserted. b) The OctetCount is less than 64, the ActivityDuration is greater than ShortEventMaxTime and the CollisionEvent signal is deasserted. ValidPacketMinTime is greater than or equal to 552 bit times and less than 565 bit times. An event whose length is greater than 74 bit times but less than 82 bit times shall increment either the shortEvents counter or the runts counter but not both. A CarrierEvent greater than or equal to 552 bit times but less than 565 bit times may or may not be counted as a runt. ValidPacketMinTime has tolerances included to provide for circuit losses between a conformance test point at the AUI and the measurement point within the state machine. Runts usually indicate collision fragments, a normal network event. In certain situations associated with large diameter networks a percentage of runts may exceed ValidPacketMinTime. The approximate minimum time for rollover of this counter is 16 hours.')
chipRptrMonitorPortCollisions = MibTableColumn((1, 3, 6, 1, 4, 1, 49, 2, 3, 1, 5, 2, 5, 2, 3, 1, 1, 12), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: chipRptrMonitorPortCollisions.setReference('Reference IEEE 802.3 Rptr Mgt, 19.2.6.2, aCollisions.')
if mibBuilder.loadTexts: chipRptrMonitorPortCollisions.setStatus('mandatory')
if mibBuilder.loadTexts: chipRptrMonitorPortCollisions.setDescription('This counter is incremented by one for any CarrierEvent signal on any port for which the CollisionEvent signal on this port is asserted. The approximate minimum time for rollover of this counter is 16 hours.')
chipRptrMonitorPortLateEvents = MibTableColumn((1, 3, 6, 1, 4, 1, 49, 2, 3, 1, 5, 2, 5, 2, 3, 1, 1, 13), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: chipRptrMonitorPortLateEvents.setReference('Reference IEEE 802.3 Rptr Mgt, 19.2.6.2, aLateEvents.')
if mibBuilder.loadTexts: chipRptrMonitorPortLateEvents.setStatus('mandatory')
if mibBuilder.loadTexts: chipRptrMonitorPortLateEvents.setDescription('This counter is incremented by one for each CarrierEvent on this port in which the CollIn(X) variable transitions to the value SQE (Ref: 9.6.6.2, IEEE 802.3 Std) while the ActivityDuration is greater than the LateEventThreshold. Such a CarrierEvent is counted twice, as both a collision and as a lateEvent. The LateEventThreshold is greater than 480 bit times and less than 565 bit times. LateEventThreshold has tolerances included to permit an implementation to build a single threshold to serve as both the LateEventThreshold and ValidPacketMinTime threshold. The approximate minimum time for rollover of this counter is 81 hours.')
chipRptrMonitorPortVeryLongEvents = MibTableColumn((1, 3, 6, 1, 4, 1, 49, 2, 3, 1, 5, 2, 5, 2, 3, 1, 1, 14), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: chipRptrMonitorPortVeryLongEvents.setReference('Reference IEEE 802.3 Rptr Mgt, 19.2.6.2, aVeryLongEvents.')
if mibBuilder.loadTexts: chipRptrMonitorPortVeryLongEvents.setStatus('mandatory')
if mibBuilder.loadTexts: chipRptrMonitorPortVeryLongEvents.setDescription('This counter is incremented by one for each CarrierEvent on this port whose ActivityDuration is greater than the MAU Jabber Lockup Protection timer TW3 (Ref: 9.6.1 & 9.6.5, IEEE 802.3 Std). Other counters may be incremented as appropriate.')
chipRptrMonitorPortDataRateMismatches = MibTableColumn((1, 3, 6, 1, 4, 1, 49, 2, 3, 1, 5, 2, 5, 2, 3, 1, 1, 15), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: chipRptrMonitorPortDataRateMismatches.setReference('Reference IEEE 802.3 Rptr Mgt, 19.2.6.2, aDataRateMismatches.')
if mibBuilder.loadTexts: chipRptrMonitorPortDataRateMismatches.setStatus('mandatory')
if mibBuilder.loadTexts: chipRptrMonitorPortDataRateMismatches.setDescription("This counter is incremented by one for each frame received on this port that meets all of the following conditions: a) The CollisionEvent signal is not asserted. b) The ActivityDuration is greater than ValidPacketMinTime. c) The frequency (data rate) is detectably mismatched from the local transmit frequency. The exact degree of mismatch is vendor specific and is to be defined by the vendor for conformance testing. When this event occurs, other counters whose increment conditions were satisfied may or may not also be incremented, at the implementor's discretion. Whether or not the repeater was able to maintain data integrity is beyond the scope of this standard.")
