chipRptrMonitorPortTotalErrors = MibTableColumn((1, 3, 6, 1, 4, 1, 49, 2, 3, 1, 5, 2, 5, 2, 3, 1, 1, 17), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: chipRptrMonitorPortTotalErrors.setStatus('mandatory')
if mibBuilder.loadTexts: chipRptrMonitorPortTotalErrors.setDescription('The total number of errors which have occurred on this port. This counter is the summation of the values of other error counters (for the same port), namely: chipRptrMonitorPortFCSErrors, chipRptrMonitorPortAlignmentErrors, chipRptrMonitorPortFrameTooLongs, chipRptrMonitorPortShortEvents, chipRptrMonitorPortLateEvents, chipRptrMonitorPortVeryLongEvents, and chipRptrMonitorPortDataRateMismatches. This counter is redundant in the sense that it is the summation of information already available through other objects. However, it is included specifically because the regular retrieval of this object as a means of tracking the health of a port provides a considerable optimization of network management traffic over the otherwise necessary retrieval of the summed counters.')
