if mibBuilder.loadTexts: ocPowerSlotClass.setDescription("The current slot power class. For a slot containing an ONcore module, this object's value ranges from 1 to 10, where 1 is the lowest power class and 10 is the highest power class. Slots assigned higher power classes will be power-enabled before slots assigned lower power classes. Similarly, slots assigned lower power classes will be power-disabled before slots assigned higher power classes. For a slot containing an ONline module, this object's value is reported as not-applicable(11) because ONline modules are not power-manageable (once an ONline module is inserted into the hub, it will consume power for as long as it remains in the hub). The value not-applicable(11) is invalid for a slot containing an ONcore module. Power class can be used to establish an ONcore module power-up and power-down priority scheme. Combined with slot location, slot power class defines the order in which slots containing ONcore modules will be power-enabled and power-disabled. For a given power class, slots are power-enabled from lowest payload slot to highest payload slot and power-disabled from highest payload slot to lowest payload slot. Slot power class is not pre-emptive; changing a slot's power class will not affect the power state of other slots. It will take effect during a slot power-up or power-down event (e.g., the failure or recovery of a power supply).")
